<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>FLI circling tests</title>
    <style>
        html,body{
            margin:0;
            background-color:black;
            display:flex;
            flex-flow:column nowrap;
            align-items:center;
        }
        svg{
            height:min(100vh,100vw);
            width:min(100vh,100vw);
            margin:auto;
            margin-bottom:5px;
        }

        .animate,.animate2{
            --l:3000;
            --fraction:0.2;
            --segment:calc(var(--l) * var(--fraction));
            /* stroke-dasharray:var(--segment); */
            stroke-linecap: round;
            stroke-dasharray: var(--segment) calc(var(--l) - var(--segment));
            stroke-dashoffset: var(--l);
            --offset:-2000px;
            --t:3s;
            animation-timing-function:ease-in-out;
        }

        .animate{
            animation: stroke-anim var(--t) infinite forwards;
        }

        .animate2{
            --l:3000;
            --fraction:0.19;
            animation: stroke-anim2 var(--t) infinite forwards;
            --offset:-1250px;
        }

        @keyframes stroke-anim{
            0% {
                stroke-dashoffset: calc(var(--l) + var(--offset));
            }
            100% {
                stroke-dashoffset: var(--offset);
            }
        }

        @keyframes stroke-anim2{
            0% {
                stroke-dashoffset: var(--offset);
            }
            100% {
                stroke-dashoffset:calc(var(--l) + var(--offset));
            }
        }


        
    </style>
    <script>
        window.onload=()=>{
            let svgs=Array.from(document.querySelectorAll('svg'));
            for(let svg of svgs){
                let path=svg.querySelector('.animate,.animate2')
                let l=path.getTotalLength();
                path.style.setProperty('--l',l+'px');
                path.style.setProperty('--t',l / 1500+'s');
            }
            
            
        }
    </script>
</head>
